	function benarkanRoleAcc ()
	{
		$role2Acc = new Role2Account();
		$arr = $role2Acc->getAll();
		$arrSudah = array ();
		global $db;
		foreach ($arr as $n => $v) {
			if (!in_array($v->role_admin_id, $arrSudah)) {
				//kalau blom di kerjakan, add dan hapus
				$arrSudah[] = $v->role_admin_id;
				$q =
					"DELETE FROM {$role2Acc->table_name} WHERE role_admin_id = '{$v->role_admin_id}' AND rc_id != '{$v->rc_id}'";
				echo $db->query($q, 0);
			}
		}

	}

